import React from 'react';

interface TextboxProps {
  data: {
    ID: string;
    type: string;
    bracket: string;
    x: string;
    y: string;
    h: string;
    w: string;
    touch: string;
  };
}

const Textbox: React.FC<TextboxProps> = ({ data }) => {
  // Assuming x, y, h, w are percentage-based for simplicity
  const style = {
    position: 'absolute' as const,
    left: `${data.x}%`,
    top: `${data.y}%`,
    width: `${data.w}%`,
    height: `${data.h}%`,
    border: '1px solid black',
  };

  return (
    <div style={style}>
      <p>Textbox ID: {data.ID}</p>
    </div>
  );
};

export default Textbox;
